import styled from 'styled-components';

const Styled = styled.div`
    .css-dev-only-do-not-override-1e67qka {
        margin-bottom: 4px;
        padding-bottom: 0;
    }
    label {
        font-weight: unset;
        padding-bottom: 2px;
    }
    input {
        height: 32px;
    }
    .ant-picker {
        height: 32px;
    }
    button {
        height: 44px;
        margin: 0 10px;
    }
    .btn-right {
        display: flex;
    }
    .btn-close {
        background-color: burlywood;
    }
    .avatar {
        width: 240px;
        height: 240px;
        margin-left: 30px;
        border-radius: 50%;
        object-fit: cover;
        object-position: center;
    }
    .ant-image-mask {
        margin: 0;
        width: 240px;
        border-radius: 50%;
    }
    .ant-image-img {
        width: 242px;
        height: 242px;
        border: 2px solid #898b8d;
        border-radius: 50%;
    }
    .ant-upload.ant-upload-select {
        width: 166px;
        height: auto;
        margin: 10px 65px;
    }
    .ant-upload-list {
        display: none;
    }
`;
export default Styled;
